import { HeroContainer, HeroTitle, HeroBackground } from './HeroElements';

const HeroSection = () => {
    return (
        <HeroContainer id="home">
            <HeroTitle>Hello</HeroTitle>
            <HeroBackground/>
        </HeroContainer>
    )
}

export default HeroSection
